def findMaxAverage(nums, k):
    if k>=len(nums): return sum(nums)/(len(nums)*1.0)
    if k==1: return max(nums)
    res=sum(nums[:k])   #初始的K个数
    ans=float('-inf')
    for i in range(len(nums)-k):
        tem=res-nums[i]+nums[i+k]
        ans=max(ans,res,tem)
        print(ans)
        res=tem
    return ans/(k*1.0)

